    static ref COUPON_KMS_SEED: String = env::var("COUPON_KMS_SEED").expect("$COUPON_KMS_SEED is not set!");
    static ref MYSTEN_EMAIL_REGEX: Regex = Regex::new(r"^([a-z0-9_+]([a-z0-9_+.]*[a-z0-9_+])?)@mystenlabs.com").unwrap();
