/// Error for Coupon email service.
#[derive(Debug)]
pub struct CouponEmailError {
    to_address: String,
}

// Report email address when displaying errors.
impl fmt::Display for CouponEmailError {
    fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result {
        write!(f, "Cannot send email to {}", self.to_address)
    }
}

/// Simple KDF Generate a (SuiAddress, Mnemonic) from seed, email and campaignID.
pub fn gen_address_and_mnemonic(email: &str, campaign: &str) ->  Result<(SuiAddress, Mnemonic), CouponEmailError> {
    let final_email = final_email(email)?;
    // First HKDF to deterministically generate entropy for Mnemonic. Required to get 12 Words.
    let hk = Hkdf::<Sha256>::new(Some(final_email.as_bytes()), COUPON_KMS_SEED.as_bytes());
    let mut okm = [0u8; 16];
    hk.expand(campaign.as_bytes(), &mut okm).unwrap();
    let mnemonic= Mnemonic::from_entropy(&okm, Language::English).unwrap();

    // Second HKDF to extend Mnemonic's entropy to 32B. Required to seed ed25519 private key gen.
    let hk2 = Hkdf::<Sha256>::new(Some(EXTEND_ENTROPY_SALT.as_bytes()), mnemonic.entropy());
    let mut okm2 = [0u8; 32];
    hk2.expand(campaign.as_bytes(), &mut okm2).unwrap();

    let ed25519_secret_key = dalek::SecretKey::from_bytes(&okm2).unwrap();
    let ed25519_public_key = dalek::PublicKey::from(&ed25519_secret_key);

    let pub_key_bytes = PublicKeyBytes::try_from(ed25519_public_key.as_byte_slice()).unwrap();

    Ok((SuiAddress::from(&pub_key_bytes), mnemonic))
}

// Return email address or extract it  when provided in the form of "name <email>".
fn final_email(email: &str) -> Result<String, CouponEmailError> {
    let mut final_email = email.to_string();
    if email.contains("<") && email.contains(">") {
        final_email = final_email[email.chars().position(|c| c == '<').unwrap()+1..final_email.len()-1].to_string();
    }
    println!("{}", final_email.clone());
    if !MYSTEN_EMAIL_REGEX.is_match(&final_email) {
        return Result::Err(CouponEmailError { to_address: email.to_string() });
    }
    Ok(final_email)
}

pub fn send_coupon_email(to_address: &str, discount: u8, mnemonic: Mnemonic, nft_id: &str) -> Result<Response, CouponEmailError> {
    let img = base64::decode(COUPONS[discount as usize / 5 - 1]).unwrap();
    let name = &to_address[..to_address.chars().position(|c| c == '<').unwrap()];
    let html_body = COUPON_EMAIL_TEMPLATE.to_string();
    let explorer_link = [EXPLORER_LINK_PREFIX, nft_id].join("");

    let mut subject: String = "Your 1st NFT | ".to_owned();
    subject.push_str(&discount.to_string());
    subject.push_str(&"% off on Adeniyi's Salad Bar!");

    let email = Message::builder()
        .from("NFT coupon <nftcoupon@gmail.com>".parse().unwrap())
        .reply_to("NFT coupon <nftcoupon@gmail.com>".parse().unwrap())
        .to(to_address.parse().unwrap())
        .subject(subject)
        .multipart(
            MultiPart::related()
                .singlepart(
                    SinglePart::builder()
                        .header(header::ContentType::TEXT_HTML)
                        .body(String::from(html_body.replace("@@@NAME@@@", name).replace("@@@DISCOUNT@@@", &discount.to_string()).replace("@@@PASSPHRASE@@@", mnemonic.phrase()).replace("@@@EXPLORER_LINK@@@", &explorer_link))
                        ),
                )
                .singlepart(
                    SinglePart::builder()
                        .header(header::ContentType::parse("image/png").unwrap())
                        .header(header::ContentDisposition::inline())
                        .header(header::ContentId::from(String::from("<123>")))
                        .body(img),
                ),
        )
        //.body(String::from("Testing email"))
        .unwrap();

    let creds = Credentials::new(MAILER_USER.to_string(), MAILER_PWD.to_string());

    // Open a remote connection to smtp server
    let mailer = SmtpTransport::relay(&MAILER_SMTP)
        .unwrap()
        .credentials(creds)
        .build();

    // Send the email
    mailer.send(&email).map_err(|_err| CouponEmailError { to_address: to_address.to_string() })
}

